class Solution {
    func maximumSum(_ nums: [Int]) -> Int {
        var res = 0
        var map = [Int: Int]()

        for num in nums {
            var mask = 0
            var n = num
            for i in 2... {
                if i * i > n { break }
                if n % i == 0 {
                    var count = 0
                    while n % i == 0 {
                        n /= i
                        count += 1
                    }
                    if count % 2 != 0 { mask ^= i }
                }
            }
            if n > 1 { mask ^= n }
            map[mask, default: 0] += num
            res = max(res, map[mask]!)
        }

        return res
    }
}
